import React from 'react'
import {ProductsPopupItemContainer, Label, CustomLink} from "./products-popup-item.styles";

const ProductsPopupItem = ({productLabel, productList}) => {  
  console.log(productList)
  return (
    <ProductsPopupItemContainer>
      <Label>{productLabel}</Label>
      {productList &&  productList.map(product => (
        <CustomLink title={product.name} to={product.linkUrl}>{product.name}</CustomLink>
      ))}
    </ProductsPopupItemContainer>
  )
}

export default ProductsPopupItem
